import React from "react";
import Card from "../../components/Card/Card";
import { posts } from "../../data";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      {posts.map((post) => (
        <Card key={post.id} post={post} />
      ))}
    </div>
  );
};

export default Home;
